import React from "react";
import Dropdown from "../Dropdown";
import { Link } from "react-router-dom";
import "./styles.module.css";

const Item = ({data}) => {

	console.log("data is: ", data);

	const deleteAction = () => {
		console.log("delete action clicked");	
	}

	return (
	<div className="card">
		<div className="d-flex justify-content-between col-12">
			<div className="col-8">
				<p className="card-title">{data.name}</p>
			</div>
			<div className="col-3 offset-2">
				<Dropdown
					icon="bx bx-dots-vertical-rounded"
					menu={
					<>
						<li className="dropdown-list">
						<Link to="/items/:id" className="dropdown-link">
							<i className="bx bx-edit dropdown-link-icon"></i>
							Edit
						</Link>
						</li>
						<li className="dropdown-list" onClick={() => deleteAction()}>
						<button className="dropdown-link">
							<i className="bx bx-trash dropdown-link-icon"></i>
							Delete
						</button>
						</li>
					</>
					}
				/>
			</div>
		</div>
		<div className="card-img-top">
		<img
			// src={require(`..\\.\\..\\..\\..\\..\\..\\..\\..\\`)}
			alt=""
			className="product-img"
		/>
		</div>
		<div className="card-product-body">
		<h1 className="product-categories">{data.description}</h1>
		<div className="flex-item">
			<p className="product-price">{data.approximateValue}</p>
			<p className="product-stock">Tradez: 10</p>
		</div>
		</div>
	</div>
	);
};

export default Item;
